import '../styles/Modal.css';
function ModalDevice({closeModal}) {
    return (
        <div className='modal'>
            <span id="close" onClick={closeModal}>&times;</span>
            <div className="modal-content">
            <h2>Add user</h2>
                <label>Description:</label>
                <input placeholder="ex: John123"></input>
                <label>Address:</label>
                <input placeholder="ex: John"></input>
                <label>Email:</label>
                <input placeholder="ex: john@gmail.com"></input>
                <label>Password:</label>
                <input placeholder="ex: PassworD!56"></input>
                <label>Role:</label>
                <select>
                    <option value="client">Client</option>
                    <option value="admin">Admin</option>
                </select>
                <button type='submit'>Add</button>
            </div>
        </div>

    );

    return(
    <div className='modal'>
        <label>Description: {descriptionText}</label>
        <label>Address: {addressText}</label>
        <label>Maximum hourly energy consumption: {energyText}</label>
    </div>

    );
}

export default ModalDevice;
